import MainTop from "../top/Main_Top";
import MainNav from "../navs/Main_Nav";
import { Slider } from "../../slider";
import slides from "../../mock.json";
import MainSidebar from "../sidebars/Main_Sidebar";
import MainCategories from "../categories/Main_Categories";

function MainPage() {
  return (
    <div className="bg-white">
      <MainTop></MainTop>
      <MainNav></MainNav>
      <div className="slider_cover">
        <Slider slider={slides}></Slider>
      </div>
      <div className="flex ">
        <MainSidebar></MainSidebar>
        <MainCategories></MainCategories>
      </div>
    </div>
  );
}
export default MainPage;



